import React, { Component } from 'react';

class Nav extends Component {
  render() {
    return(
      <nav className='buttons col-12'>
        <ul className='row' style={{listStyle: 'none'}}>
          <li className='col-2'>
              <span class="iconify" data-icon="ic:sharp-edit" style={{fontSize: '4em'}} data-inline="false"></span>
          </li>
          <li className='col-2'>
            <span class="iconify" data-icon="ic:baseline-shopping-cart" style={{fontSize:'4em'}} data-inline="false"></span>
          </li>
        </ul>
      </nav>
    )
  }
}

export default Nav;
